@JacobAndCo Brilliant Pendant Pavé is a versatile artistic timepiece. When not attached to its 18K rose gold chain, the watch can be placed on any surface where it functions as a contemporary table clock. 

Either way admirers can view the elegantly crafted skeletonized @JacobAndCo. Caliber JCAM01 manual winding movement. There’s also 347 brilliant round diamonds that adorn the 18k rose gold bezel and crown.

